void WebSocketAuthenticationHandlerInterceptorForTesting::OnAuthRequired(const ::net::AuthChallengeInfo& info,
    const ::scoped_refptr<::net::HttpResponseHeaders>& headers, const ::net::IPEndPoint& remote_endpoint, OnAuthRequiredCallback callback)
{
    GetForwardingInterface()->OnAuthRequired(std::move(info), std::move(headers), std::move(remote_endpoint), std::move(callback));
}
WebSocketAuthenticationHandlerAsyncWaiter::WebSocketAuthenticationHandlerAsyncWaiter(WebSocketAuthenticationHandler* proxy)
    : proxy_(proxy)
{
}

WebSocketAuthenticationHandlerAsyncWaiter::~WebSocketAuthenticationHandlerAsyncWaiter() = default;

void WebSocketAuthenticationHandlerAsyncWaiter::OnAuthRequired(const ::net::AuthChallengeInfo& info, const ::scoped_refptr<::net::HttpResponseHeaders>& headers,
    const ::net::IPEndPoint& remote_endpoint, std::optional<::net::AuthCredentials>* out_credentials)
{
    base::RunLoop loop;
    proxy_->OnAuthRequired(std::move(info), std::move(headers), std::move(remote_endpoint),
        base::BindOnce(
            [](base::RunLoop* loop, std::optional<::net::AuthCredentials>* out_credentials, const std::optional<::net::AuthCredentials>& credentials) {
                *out_credentials = std::move(credentials);
                loop->Quit();
            },
            &loop, out_credentials));
    loop.Run();
}

std::optional<::net::AuthCredentials> WebSocketAuthenticationHandlerAsyncWaiter::OnAuthRequired(
    const ::net::AuthChallengeInfo& info, const ::scoped_refptr<::net::HttpResponseHeaders>& headers, const ::net::IPEndPoint& remote_endpoint)
{
    std::optional<::net::AuthCredentials> async_wait_result;
    OnAuthRequired(std::move(info), std::move(headers), std::move(remote_endpoint), &async_wait_result);
    return async_wait_result;
}

